import React from "react"

import {BrowserRouter as Router, Route, Switch} from "react-router-dom";

class App extends React.Component {
  render() {
    return (
      <div style={{fontFamily: "Poppins"}}>
        <Router>
            <Switch></Switch>
        </Router>
      </div>
    )
  }
}

export default App
